sys_variable_value.value:
(function execute(inputs, outputs) {
    try {


        var tableName = inputs.table_name;
        var matchFields = inputs.match_fields.split(',').map(function(f) {
            return f.trim();
        });

        var gr = new GlideRecord(tableName);
        if (!gr.isValid()) {
            throw new Error("Invalid table name: " + tableName);
        }

        // Validate match fields
        for (var i = 0; i < matchFields.length; i++) {
            if (!gr.isValidField(matchFields[i])) {
                throw new Error("Invalid match field: " + matchFields[i]);
            }
        }

        var query = matchFields.map(function(field) {
            return field + 'ISNOTEMPTY';
        }).join('^');

        gr.addEncodedQuery(query);
        gr.query();

        var seen = {};
        var flaggedPairs = [];

        while (gr.next()) {
            var key = matchFields.map(function(field) {
                return gr.getValue(field);
            }).join('|');

            if (seen[key]) {
                // Flag as duplicate
                if (gr.isValidField('u_duplicate_of')) {
                    gr.setValue('u_duplicate_of', seen[key]); // Reference to original
                }else{
                    throw new Error("As part of Action table needs to have u_duplicate_of field to flag duplicates");
                }

                gr.update();
                flaggedPairs.push({ original: seen[key], flagged: gr.sys_id.toString() });
            } else {
                seen[key] = gr.sys_id.toString();
            }
        }

        outputs.merged_pairs = flaggedPairs;

    } catch (err) {
        gs.error("Duplicate Flagging Error: " + err.message);
        outputs.error = err.message;
    }
})(inputs, outputs);

